import { useState } from 'react';
import Productos from './Productos';
import '../estilos/carrito-productos.css';

export default function Categoria() {

  const [filtros, setFiltros] = useState({
    categoria: "",
    estilo: "",
    talla: "",
    minPrice: 50,
    maxPrice: 400
  });

  const actualizarFiltro = (campo, valor) => {
    setFiltros({
      ...filtros,
      [campo]: valor
    });
  };

  return (
    <article className="category-page">

      <section className="category-content">

        <aside className="filters">
          <h2>Filtros <i className="fas fa-filter"></i></h2>

          {/* CATEGOR√çA */}
          <div className="filter-group">
            <ul>
              <li><button onClick={() => actualizarFiltro("categoria", "Camisetas")}>Camisetas</button></li>
              <li><button onClick={() => actualizarFiltro("categoria", "Pantalones Cortos")}>Pantalones Cortos</button></li>
              <li><button onClick={() => actualizarFiltro("categoria", "Sudaderas")}>Sudaderas</button></li>
              <li><button onClick={() => actualizarFiltro("categoria", "Jeans")}>Jeans</button></li>
            </ul>
          </div>

          {/* PRECIO */}
          <div className="price-filter">
            <h3>Precio</h3>
            <input 
              type="range" 
              min="50" max="400"
              value={filtros.minPrice}
              onChange={e => actualizarFiltro("minPrice", Number(e.target.value))}
            />
            <input 
              type="range" 
              min="50" max="400"
              value={filtros.maxPrice}
              onChange={e => actualizarFiltro("maxPrice", Number(e.target.value))}
            />
            <p>Q{filtros.minPrice} - Q{filtros.maxPrice}</p>
          </div>

          {/* TALLA */}
          <div className="filter-group">
            <h3>Talla</h3>
            <div className="size-options">
              {["XS","S","M","L","XL"].map(t => (
                <span 
                  key={t}
                  className="size-box"
                  onClick={() => actualizarFiltro("talla", t)}
                >
                  {t}
                </span>
              ))}
            </div>
          </div>

          {/* ESTILO */}
          <div className="filter-group">
            <h3>Estilo</h3>
            <ul>
              <li><button onClick={() => actualizarFiltro("estilo", "Casual")}>Casual</button></li>
              <li><button onClick={() => actualizarFiltro("estilo", "Formal")}>Formal</button></li>
              <li><button onClick={() => actualizarFiltro("estilo", "Fiesta")}>Fiesta</button></li>
              <li><button onClick={() => actualizarFiltro("estilo", "Gimnasio")}>Gimnasio</button></li>
            </ul>
          </div>
        </aside>

        <section className="product-listing">
          {/* PASAMOS LOS FILTROS AL COMPONENTE PRODUCTOS */}
          <Productos filtros={filtros} />
        </section>

      </section>
    </article>
  );
}
